import React from 'react';
import { Link } from 'react-router-dom';
import './Welcome.css';  // Ensure the CSS file is imported

// Import the uploaded image
import welcomeImage from './images/welcome2.png';

function Welcome() {
    return (
        <div className="welcome-container">
            <div className="welcome-image-overlay">
                <img src={welcomeImage} alt="Welcome Background" className="welcome-background" />
            </div>
            <div className="welcome-content">
                <h1 className="welcome-title">Welcome</h1>
                <p className="welcome-description">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                <div className="auth-buttons">
                    <button className="auth-button google">Sign in with Google</button>
                    <button className="auth-button facebook">Sign in with Facebook</button>
                    <button className="auth-button twitter">Sign in with Twitter</button>
                    <button className="auth-button email">Sign up with email</button>
                </div>
                <div className="additional-links">
                    <span>No account? <Link to="/signup" className="link">Create account</Link></span>
                    <Link to="/terms" className="terms-link">Terms of service</Link>
                </div>
            </div>
        </div>
    );
}

export default Welcome;
